
nome: Sopa à portuguesa

descrição: Uma sopa preparada com a mistura de legumes para sopa do Gota Doce, pronta em apenas 30 minutos. Esta sopa à portuguesa é carregada de sabor!

dificuldade: fácil

minutos-de-preparação: 30

número-de-doses: 8

etiquetas:
- Sabores mediterrânicos
- Sem leite
- Vegan

ingredientes:
- nome: Cebola em cubos congelada
  quantidade: 150 g
- nome: Azeite
  quantidade: 3 c. sopa
- nome: Batata
  quantidade: 300 g
- nome: Abóbora
  quantidade: 300 g
- nome: Mistura de legumes emb. para sopa portuguesa
  quantidade: '1'
- nome: Sal
  quantidade: 1 c. sobremesa
- nome: Massa cuscuz
  quantidade: 50 g

valores-nutricionais:
- dose: 105 Kcal
  nome: Energia
  percentagem-do-vdr-adulto: 5
- dose: 4,2 g
  nome: Gordura
  percentagem-do-vdr-adulto: 6
- dose: 0,7 g
  nome: Gordura, das quais saturadas
  percentagem-do-vdr-adulto: 4
- dose: 13,5 g
  nome: Hidratos de carbono
  percentagem-do-vdr-adulto: null
- dose: 3,8 g
  nome: Hidratos de carbono, dos quais açúcares
  percentagem-do-vdr-adulto: 4
- dose: 2,7 g
  nome: Fibra
  percentagem-do-vdr-adulto: 11
- dose: 2,8 g
  nome: Proteínas
  percentagem-do-vdr-adulto: null

passos:
- - Numa panela, leve ao lume a cebola com o azeite.
  - Descasque as batatas e a abóbora, corte-as em cubos e junte à cebola. Deixe suar com a panela tapada, durante 5 minutos.
  - Junte a mistura de legumes e tempere com o sal. Regue com água a ferver e deixe cozer, durante cerca de 15 minutos.
  - Retire com uma escumadeira cerca de 1/3 dos legumes cozidos e reserve. Triture os restantes com a varinha mágica até obter um creme.
  - Adicione a massa e deixe ferver mais 7 minutos.
  - Quando estiver pronta, introduza os legumes cozidos reservados e mexa.

